import styled from 'styled-components'

const WrapperIcone = styled.span`
  font-size: 18px;
  font-weight: bold;
  transition: 400ms;
  color: white;
  background-color: ${props => props.color};
  margin: 5px;
  :hover {
    cursor: pointer;
    transform: scale(1.1);
  }
`

export { WrapperIcone }
